  false,\n\t\"url\": null,\n\t\"notes\": \"nThe Former Soviet Union Hydrological Snow
  Surveys are based on observations made by personnel at 1,345 sites throughout the
  Former Soviet Union between 1966 and 1990, and over 200 of those sites between 1991
  and 1996. These observations include snow depths at World Meteorological Organization
  (WMO) stations and snow depth and snow water equivalent measured over a nearby snow
  course transect. The station snow depth measurements are a ten-day average of individual
  snow depth measurements. The transect snow depth data are the spatial average of
  100 to 200 individual measuring points. The transect snow water equivalent is the
  spatial average of 20 individual measuring points. Data were acquired from the Institute
  of Geography, Russian Academy of Sciences Moscow, and data were digitized in Russia
  under the supervision of Professor Alexander Krenke.The development of this data
  set was funded by the NOAA Environmental  Services, Data, and Information Management
  (ESDIM) program through the NOAA/NESDIS National Geophysical Data Center (NGDC).n\",\n\t\"license_title\":
